import{_ as e,c as t,o as s,at as n}from"./chunks/framework.Cnsi11we.js";const p=JSON.parse('{"title":"Interface: Maqam","description":"","frontmatter":{},"headers":[],"relativePath":"library/api/models/Maqam/interfaces/Maqam.md","filePath":"library/api/models/Maqam/interfaces/Maqam.md","lastUpdated":null}'),i={name:"library/api/models/Maqam/interfaces/Maqam.md"};function r(o,a,c,l,d,h){return s(),t("div",null,[...a[0]||(a[0]=[n('<p><a href="./../../../README"><strong>DiArMaqAr TypeScript Library v0.1.0</strong></a></p><hr><p><a href="./../../../modules">DiArMaqAr TypeScript Library</a> / <a href="./../README">models/Maqam</a> / Maqam</p><h1 id="interface-maqam" tabindex="-1">Interface: Maqam <a class="header-anchor" href="#interface-maqam" aria-label="Permalink to &quot;Interface: Maqam&quot;">​</a></h1><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L471" target="_blank" rel="noreferrer">models/Maqam.ts:471</a></p><p>Represents a concrete, tuning-system-specific maqam with actual pitch classes.</p><p>This interface represents a maqam that has been &quot;realized&quot; within a specific tuning system, containing actual pitch classes with frequencies and intervallic relationships for both ascending and descending sequences. Unlike MaqamData (which contains only abstract note names), a Maqam interface instance is playable and can be used for audio synthesis and comprehensive analysis.</p><p><strong>Tahlil vs Taswir</strong>:</p><ul><li><strong>Tahlil</strong> (transposition: false): The original form of the maqam starting from its traditional root note (e.g., Maqam Farahfazza starting on yegah)</li><li><strong>Taswir</strong> (transposition: true): A transposition of the maqam starting from a different pitch class while preserving intervallic relationships and directional characteristics (e.g., Maqam Farahfazza al-Rast starting on rast)</li></ul><p><strong>Advanced Features</strong>:</p><ul><li><strong>Embedded ajnas analysis</strong>: Algorithm identifies all possible ajnās patterns within both ascending and descending sequences using cents tolerance matching</li><li><strong>Automatic transposition</strong>: Both sequences and embedded ajnas are systematically transposed while maintaining authentic intervallic structure</li><li><strong>suyur integration</strong>: Associated melodic development pathways are automatically transposed with note name conversion and jins/maqam reference adjustment</li></ul><p>The transposition algorithm separately processes both sequences, ensuring all required note names exist within the tuning system&#39;s four octaves before generating a valid transposition.</p><h2 id="properties" tabindex="-1">Properties <a class="header-anchor" href="#properties" aria-label="Permalink to &quot;Properties&quot;">​</a></h2><h3 id="maqamid" tabindex="-1">maqamId <a class="header-anchor" href="#maqamid" aria-label="Permalink to &quot;maqamId&quot;">​</a></h3><blockquote><p><strong>maqamId</strong>: <code>string</code></p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L473" target="_blank" rel="noreferrer">models/Maqam.ts:473</a></p><p>ID of the original maqam this instance is based on</p><hr><h3 id="name" tabindex="-1">name <a class="header-anchor" href="#name" aria-label="Permalink to &quot;name&quot;">​</a></h3><blockquote><p><strong>name</strong>: <code>string</code></p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L480" target="_blank" rel="noreferrer">models/Maqam.ts:480</a></p><p>Name of this maqam instance. For tahlil: original name (e.g., &quot;Maqam Farahfazza&quot;) For taswir: includes transposition info (e.g., &quot;Maqam Farahfazza al-Rast&quot;)</p><hr><h3 id="transposition" tabindex="-1">transposition <a class="header-anchor" href="#transposition" aria-label="Permalink to &quot;transposition&quot;">​</a></h3><blockquote><p><strong>transposition</strong>: <code>boolean</code></p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L486" target="_blank" rel="noreferrer">models/Maqam.ts:486</a></p><p>Whether this is a transposition (taswir) or original form (tahlil). false = tahlil (original), true = taswir (transposition)</p><hr><h3 id="ascendingpitchclasses" tabindex="-1">ascendingPitchClasses <a class="header-anchor" href="#ascendingpitchclasses" aria-label="Permalink to &quot;ascendingPitchClasses&quot;">​</a></h3><blockquote><p><strong>ascendingPitchClasses</strong>: <a href="./../../PitchClass/interfaces/default"><code>default</code></a>[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L492" target="_blank" rel="noreferrer">models/Maqam.ts:492</a></p><p>Array of actual pitch classes for the ascending sequence (ṣuʿūd). These are the concrete, playable pitches within the tuning system.</p><hr><h3 id="ascendingpitchclassintervals" tabindex="-1">ascendingPitchClassIntervals <a class="header-anchor" href="#ascendingpitchclassintervals" aria-label="Permalink to &quot;ascendingPitchClassIntervals&quot;">​</a></h3><blockquote><p><strong>ascendingPitchClassIntervals</strong>: <a href="./../../PitchClass/interfaces/PitchClassInterval"><code>PitchClassInterval</code></a>[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L498" target="_blank" rel="noreferrer">models/Maqam.ts:498</a></p><p>Intervallic relationships between consecutive pitch classes in ascending sequence. These intervals remain consistent between tahlil and taswir forms.</p><hr><h3 id="ascendingmaqamajnas" tabindex="-1">ascendingMaqamAjnas? <a class="header-anchor" href="#ascendingmaqamajnas" aria-label="Permalink to &quot;ascendingMaqamAjnas?&quot;">​</a></h3><blockquote><p><code>optional</code> <strong>ascendingMaqamAjnas</strong>: (<a href="./../../Jins/interfaces/Jins"><code>Jins</code></a> | <code>null</code>)[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L504" target="_blank" rel="noreferrer">models/Maqam.ts:504</a></p><p>Optional array of embedded ajnas found within the ascending sequence. Generated through algorithmic pattern matching against known ajnās database.</p><hr><h3 id="descendingpitchclasses" tabindex="-1">descendingPitchClasses <a class="header-anchor" href="#descendingpitchclasses" aria-label="Permalink to &quot;descendingPitchClasses&quot;">​</a></h3><blockquote><p><strong>descendingPitchClasses</strong>: <a href="./../../PitchClass/interfaces/default"><code>default</code></a>[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L510" target="_blank" rel="noreferrer">models/Maqam.ts:510</a></p><p>Array of actual pitch classes for the descending sequence (hubūṭ). May differ from ascending sequence in asymmetric maqamat.</p><hr><h3 id="descendingpitchclassintervals" tabindex="-1">descendingPitchClassIntervals <a class="header-anchor" href="#descendingpitchclassintervals" aria-label="Permalink to &quot;descendingPitchClassIntervals&quot;">​</a></h3><blockquote><p><strong>descendingPitchClassIntervals</strong>: <a href="./../../PitchClass/interfaces/PitchClassInterval"><code>PitchClassInterval</code></a>[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L516" target="_blank" rel="noreferrer">models/Maqam.ts:516</a></p><p>Intervallic relationships between consecutive pitch classes in descending sequence. These intervals remain consistent between tahlil and taswir forms.</p><hr><h3 id="descendingmaqamajnas" tabindex="-1">descendingMaqamAjnas? <a class="header-anchor" href="#descendingmaqamajnas" aria-label="Permalink to &quot;descendingMaqamAjnas?&quot;">​</a></h3><blockquote><p><code>optional</code> <strong>descendingMaqamAjnas</strong>: (<a href="./../../Jins/interfaces/Jins"><code>Jins</code></a> | <code>null</code>)[]</p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L522" target="_blank" rel="noreferrer">models/Maqam.ts:522</a></p><p>Optional array of embedded ajnas found within the descending sequence. Generated through algorithmic pattern matching against known ajnās database.</p><hr><h3 id="modulations" tabindex="-1">modulations? <a class="header-anchor" href="#modulations" aria-label="Permalink to &quot;modulations?&quot;">​</a></h3><blockquote><p><code>optional</code> <strong>modulations</strong>: <a href="./../../Jins/interfaces/AjnasModulations"><code>AjnasModulations</code></a> | <a href="./MaqamatModulations"><code>MaqamatModulations</code></a></p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L528" target="_blank" rel="noreferrer">models/Maqam.ts:528</a></p><p>Optional modulation possibilities to other maqamat or ajnas. Defines possible transitions from this maqam to others.</p><hr><h3 id="numberofhops" tabindex="-1">numberOfHops? <a class="header-anchor" href="#numberofhops" aria-label="Permalink to &quot;numberOfHops?&quot;">​</a></h3><blockquote><p><code>optional</code> <strong>numberOfHops</strong>: <code>number</code></p></blockquote><p>Defined in: <a href="https://github.com/Music-Intelligence-Lab/DiArMaqAr/blob/6f1c81e1c50000c844884af75834b700ae00e423/src/models/Maqam.ts#L531" target="_blank" rel="noreferrer">models/Maqam.ts:531</a></p><p>Optional number of steps/hops for modulation analysis</p>',67)])])}const f=e(i,[["render",r]]);export{p as __pageData,f as default};
